"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[3275],{43191:(e,t,a)=>{a.r(t),a.d(t,{default:()=>s,johnChapter18PL:()=>n});const n={chapter:18,title:"Jean 18",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"To powiedziawszy Jezus, wyszed\u0142 z uczniami swymi za potok Cedron, gdzie by\u0142 ogr\xf3d, do kt\xf3rego wszed\u0142 on i uczniowie jego.",strong:[{text:"avec",strong:"G1848",start:41,end:45},{text:"dans",strong:"H6887",start:124,end:128}]},{number:2,text:"A wiedzia\u0142 i Judasz, kt\xf3ry go zdradzi\u0142, o tem miejscu; bo si\u0119 tam Jezus cz\u0119stokro\u0107 z uczniami swymi schodzi\u0142.",strong:[]},{number:3,text:"Judasz tedy wzi\u0105wszy rot\u0119, i od przedniejszych kap\u0142an\xf3w i od Faryzeusz\xf3w s\u0142ugi, przyszed\u0142 tam z latarniami, i z pochodniami, i z broni.",strong:[{text:"avec",strong:"G1848",start:123,end:127}]},{number:4,text:"A Jezus wiedz\u0105c o wszystkiem, co mia\u0142o przyj\u015b\u0107 na\u0144, wyszed\u0142, i rzek\u0142 im: Kogo szukacie?",strong:[{text:"tout",strong:"G3956",start:15,end:19},{text:"arriver",strong:"G1096",start:38,end:45}]},{number:5,text:"Odpowiedzieli mu: Jezusa Nazare\u0144skiego. Rzek\u0142 im Jezus: Jam jest. A sta\u0142 i Judasz, kt\xf3ry go zdradzi\u0142, z nimi.",strong:[{text:"avec",strong:"G1848",start:99,end:103}]},{number:6,text:"A skoro im rzek\u0142: Jam jest, ust\u0105pili nazad, i upadli na ziemi\u0119.",strong:[{text:"terre",strong:"H776",start:71,end:76}]},{number:7,text:"Tedy ich zasi\u0119 pyta\u0142: Kogo szukacie? A oni rzekli: Jezusa Nazare\u0144skiego.",strong:[{text:"nouveau",strong:"G2537",start:19,end:26}]},{number:8,text:"Odpowiedzia\u0142 Jezus: Powiedzia\u0142em wam, \u017cem ja jest; a je\u017ali mnie szukacie, pu\u015b\u0107cie te, niech id\u0105.",strong:[{text:"aller",strong:"G4198",start:91,end:96}]},{number:9,text:"Aby si\u0119 wype\u0142ni\u0142o s\u0142owo, kt\xf3re powiedzia\u0142: \u017be z tych, kt\xf3re\u015b mi da\u0142, \u017cadnego nie straci\u0142em.",strong:[{text:"parole",strong:"G3056",start:37,end:43},{text:"aucun",strong:"G3762",start:76,end:81}]},{number:10,text:"Tedy Szymon Piotr maj\u0105c miecz, doby\u0142 go, i uderzy\u0142 s\u0142ug\u0119 najwy\u017cszego kap\u0142ana, i uci\u0105\u0142 mu ucho prawe; a by\u0142o imi\u0119 s\u0142udze onemu Malchus.",strong:[{text:"serviteur",strong:"G1401",start:53,end:62},{text:"serviteur",strong:"G1401",start:125,end:134}]},{number:11,text:"I rzek\u0142 Jezus Piotrowi: W\u0142\xf3\u017c miecz tw\xf3j do pochwy; izali kielicha, kt\xf3ry mi da\u0142 Ojciec, nie mam pi\u0107?",strong:[{text:"dans",strong:"H6887",start:36,end:40},{text:"coupe",strong:"H3563",start:74,end:79}]},{number:12,text:"Tedy rota i rotmistrz, i s\u0142udzy \u017bydowscy pojmali Jezusa, i zwi\u0105zali go.",strong:[]},{number:13,text:"I wiedli go najpierwej do Annasza; bo by\u0142 \u015bwiekrem Kaifasza, kt\xf3ry by\u0142 najwy\u017cszym kap\u0142anem roku onego.",strong:[{text:"beau",strong:"G2570",start:52,end:56},{text:"cette",strong:"G3778",start:107,end:112}]},{number:14,text:"A Kaifasz by\u0142 ten, kt\xf3ry radzi\u0142 \u017bydom, \u017ce po\u017cyteczno jest, aby jeden cz\u0142owiek umar\u0142 za lud.",strong:[{text:"seul",strong:"G3439",start:84,end:88},{text:"homme",strong:"G444",start:89,end:94},{text:"peuple",strong:"G1484",start:109,end:115}]},{number:15,text:"I szed\u0142 za Jezusem Szymon Piotr, i drugi ucze\u0144; a ten ucze\u0144 by\u0142 znajomy najwy\u017cszemu kap\u0142anowi, i wszed\u0142 z Jezusem do sieni najwy\u017cszego kap\u0142ana.",strong:[{text:"avec",strong:"G1848",start:14,end:18},{text:"disciple",strong:"G3101",start:28,end:36},{text:"disciple",strong:"G3101",start:56,end:64},{text:"avec",strong:"G1848",start:117,end:121},{text:"dans",strong:"H6887",start:128,end:132}]},{number:16,text:"Ale Piotr sta\u0142 u drzwi zewn\u0105trz. Wyszed\u0142 tedy on drugi ucze\u0144, kt\xf3ry by\u0142 znajomy najwy\u017cszemu kap\u0142anowi, i rzek\u0142 od\u017awiernej, i wprowadzi\u0142 Piotra.",strong:[{text:"disciple",strong:"G3101",start:51,end:59}]},{number:17,text:"Tedy rzek\u0142a dziewka od\u017awierna Piotrowi: Izali i ty nie jeste\u015b z uczni\xf3w tego cz\u0142owieka? Rzek\u0142 on: Nie jestem.",strong:[{text:"homme",strong:"G444",start:90,end:95}]},{number:18,text:"A stali s\u0142udzy i s\u0142udzy, kt\xf3rzy byli ogie\u0144 naczynili, (bo by\u0142a zima,) i grzali si\u0119; sta\u0142 te\u017c z nimi Piotr, i grza\u0142 si\u0119.",strong:[{text:"avec",strong:"G1848",start:144,end:148}]},{number:19,text:"Tedy najwy\u017cszy kap\u0142an pyta\u0142 Jezusa o uczni\xf3w jego, i o nauce jego.",strong:[]},{number:20,text:"Odpowiedzia\u0142 mu Jezus: Ja jawnie m\xf3wi\u0142em \u015bwiatu; jam zawsze naucza\u0142 w b\xf3\u017cnicy i w ko\u015bciele, gdzie si\u0119 zawsze zchodz\u0105 \u017bydowie, a potajemnie nic nie m\xf3wi\u0142em.",strong:[{text:"monde",strong:"G2889",start:46,end:51},{text:"toujours",strong:"H5769",start:58,end:66},{text:"dans",strong:"H6887",start:76,end:80},{text:"dans",strong:"H6887",start:97,end:101},{text:"rien",strong:"G3762",start:156,end:160}]},{number:21,text:"Przecz\u017ce mi\u0119 pytasz? pytaj tych, kt\xf3rzy s\u0142yszeli, com im m\xf3wi\u0142; oto ci wiedz\u0105, com ja m\xf3wi\u0142.",strong:[]},{number:22,text:"A gdy to powiedzia\u0142, jeden ze s\u0142ug tam stoj\u0105cych da\u0142 policzek Jezusowi, m\xf3wi\u0105c: Tak odpowiadasz najwy\u017cszemu kap\u0142anowi?",strong:[]},{number:23,text:"Odpowiedzia\u0142 mu Jezus: Je\u017alim \u017ale m\xf3wi\u0142, wydaj \u015bwiadectwo o z\u0142em; a je\u017alim dobrze, przecz\u017ce mi\u0119 bijesz?",strong:[{text:"voir",strong:"G1492",start:39,end:43},{text:"bien",strong:"H2896",start:79,end:83}]},{number:24,text:"I pos\u0142a\u0142 go Annasz zwi\u0105zanego do Kaifasza, najwy\u017cszego kap\u0142ana.",strong:[]},{number:25,text:"A Szymon Piotr sta\u0142 i grza\u0142 si\u0119. I rzekli mu: Aza\u017c i ty nie jeste\u015b z uczni\xf3w jego? Zaprza\u0142 si\u0119 on, i rzek\u0142: Nie jestem.",strong:[]},{number:26,text:"Rzek\u0142 jeden ze s\u0142ug najwy\u017cszego kap\u0142ana, pokrewny onego, kt\xf3remu Piotr uci\u0105\u0142 ucho: Aza\u017cem ja ci\u0119 nie widzia\u0142 z nim w ogrodz\u0119?",strong:[{text:"avec",strong:"G1848",start:121,end:125},{text:"dans",strong:"H6887",start:130,end:134}]},{number:27,text:"I za\u015b Piotr zaprza\u0142 si\u0119; a wnet\u017ce kogut zapia\u0142.",strong:[{text:"nouveau",strong:"G2537",start:17,end:24}]},{number:28,text:"I wiedli Jezusa od Kaifasza do ratusza; a by\u0142o rano. Ale oni nie weszli do ratusza, aby si\u0119 nie zmazali, ale \u017ceby jedli wielkanoc.",strong:[{text:"dans",strong:"H6887",start:101,end:105}]},{number:29,text:"Wyszed\u0142 tedy Pi\u0142at do nich, i rzek\u0142: Jak\u0105 skarg\u0119 wnosicie przeciwko temu cz\u0142owiekowi?",strong:[{text:"aller",strong:"G4198",start:24,end:29},{text:"contre",strong:"G2596",start:78,end:84},{text:"homme",strong:"G444",start:89,end:94}]},{number:30,text:"Odpowiedzieli i rzekli mu: Byby ten nie by\u0142 z\u0142oczy\u0144c\u0105, nie byliby\u015bmy go tobie wydali.",strong:[]},{number:31,text:"Tedy im rzek\u0142 Pi\u0142at: We\u017amijcie wy jego, a wed\u0142ug zakonu waszego s\u0105d\u017acie go. I rzekli mu \u017bydowie: Nam si\u0119 nie godzi zabi\u0107 nikogo.",strong:[{text:"selon",strong:"G2531",start:60,end:65},{text:"personne",strong:"G3762",start:135,end:143},{text:"mort",strong:"H6757",start:146,end:150}]},{number:32,text:"Aby si\u0119 wype\u0142ni\u0142o s\u0142owo Jezusowe, kt\xf3re powiedzia\u0142, oznajmuj\u0105c, jak\u0105 by \u015bmierci\u0105 mia\u0142 umrze\u0107.",strong:[{text:"parole",strong:"G3056",start:32,end:38},{text:"mort",strong:"H6757",start:89,end:93}]},{number:33,text:"Tedy Pi\u0142at wszed\u0142 zasi\u0119 do ratusza, i zawo\u0142a\u0142 Jezusa, i rzek\u0142 mu: Ty\u015b jest kr\xf3l \u017bydowski?",strong:[{text:"dans",strong:"H6887",start:14,end:18}]},{number:34,text:"Odpowiedzia\u0142 mu Jezus: Od siebie li to m\xf3wisz, czyli inni tobie powiedzieli o mnie?",strong:[]},{number:35,text:"Odpowiedzia\u0142 Pi\u0142at: Aza\u017cem ja jest \u017bydem? Nar\xf3d tw\xf3j i przedniejsi kap\u0142ani podali mi\u0119 tobie; co\u015b uczyni\u0142?",strong:[{text:"Juif",strong:"G2453",start:30,end:34},{text:"nation",strong:"G1484",start:39,end:45}]},{number:36,text:"Odpowiedzia\u0142 Jezus: Kr\xf3lestwo moje nie jest z tego \u015bwiata; by by\u0142o z tego \u015bwiata kr\xf3lestwo moje, s\u0142udzy moi pewnie by walczyli, abym nie by\u0142 podan \u017bydom; ale teraz kr\xf3lestwo moje nie jest st\u0105d.",strong:[{text:"monde",strong:"G2889",start:28,end:33},{text:"monde",strong:"G2889",start:78,end:83}]},{number:37,text:"Tedy mu rzek\u0142 Pi\u0142at: A tak kr\xf3lem jeste\u015b? Odpowiedzia\u0142 Jezus: Ty powiadasz, \u017cem ja jest kr\xf3l. Jam si\u0119 na to narodzi\u0142, i na tom przyszed\u0142 na \u015bwiat, abym \u015bwiadczy\u0142 prawdzie; ka\u017cdy, kt\xf3ry jest z prawdy, s\u0142ucha g\u0142osu mego.",strong:[{text:"dans",strong:"H6887",start:99,end:103},{text:"monde",strong:"G2889",start:107,end:112},{text:"rendre",strong:"G1743",start:118,end:124}]},{number:38,text:"Rzek\u0142 mu Pi\u0142at: C\xf3\u017c jest prawda? A to powiedziawszy, wyszed\u0142 zasi\u0119 do \u017byd\xf3w, i rzek\u0142 im: Ja \u017cadnej winy nie znajduj\u0119 w nim.",strong:[{text:"avoir",strong:"G1372",start:47,end:52},{text:"nouveau",strong:"G2537",start:76,end:83},{text:"aller",strong:"G4198",start:89,end:94},{text:"aucun",strong:"G3762",start:140,end:145}]},{number:39,text:"Ale jest u was zwyczaj, abym wam jednego puszcza\u0142 w wielkanoc; chcecie\u017c tedy, abym wam pu\u015bci\u0142 kr\xf3la \u017bydowskiego?",strong:[{text:"comme",strong:"G2531",start:6,end:11}]},{number:40,text:"Tedy zasi\u0119 zawo\u0142ali wszyscy, m\xf3wi\u0105c: Nie tego, ale Barabbasza. A by\u0142 Barabbasz \u0142otr.",strong:[{text:"nouveau",strong:"G2537",start:9,end:16}]}]},s=n}}]);
